use alohomora::pcr::{PrivacyCriticalRegion, Signature};

fn main(){
    let plus_two = |x: u8| { x + 2 };
      
    fn plus_2(x: u8) -> u8 { x + 2 } 

    let _pcr = PrivacyCriticalRegion::new(|x: u8| { plus_two(x) + plus_2(x)},
        Signature {username: "corinnt", 
            signature: ""}, 
        Signature {username: "corinnt", 
            signature: ""},
        Signature {username: "corinnt", 
            signature: ""}); 
}







